var Minimatch=require("../minimatch.js").Minimatch,tap=require("tap");tap.test("cache test",function(b){var c=new Minimatch("a?b"),a=new Minimatch("a?b");b.equal(c,a,"should get the same object");for(a=0;100>a;a++)new Minimatch("a"+a);a=new Minimatch("a?b");b.notEqual(c,a,"cache should have dropped");b.end()});
